import { BrowserRouter, Routes, Route } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import Student from "./Student.js";

function App() {
  return (
    <div className="App">
        <BrowserRouter>
          <Routes>
            <Route exact path="/" Component={Student}  />
          </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
